import "./Header.css";
import React from "react";

const Header = () =>{

    return(
        <div className="card">
            <div className="card-holder">
                <div className="image-div">
                    
                </div>
                <div className="details-div">
                    <ul className="">
                        <li>Coin</li>
                        <li>Price</li>
                        <li>Change in 24hr</li>
                    </ul>
                </div>
                
            </div>
        </div>
    )
}

export default Header;
